	add("phenetics", "{\"term\":\"phenetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of numerical systematics in which organisms are grouped based upon the total or relative number of shared characteristics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Alec L. Panchen, \u0027Classification, Evolution, and the Nature of Biology\u0027, [http://books.google.com.au/books?id\u003dr-6SFNkjqKAC\u0026amp;pg\u003dPA132\u0026amp;dq\u003d%22phenetics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFd4VUoOGCInIkgWUsYHYBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phenetics%22\u0026amp;f\u003dfalse page 132\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We have seen in Chapter 6 and the previous chapters that dissatisfaction with traditional taxonomy gave rise, after the Second World War, to two distinct attempts at a remedy - \u0027\u0027phenetics\u0027\u0027 and cladistics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, F.G. Priest, Michael Goodfellow, \u0027Preface\u0027, \u0027Applied Microbial Systematics\u0027, [http://books.google.com.au/books?id\u003dto76XXSL6iEC\u0026amp;pg\u003dPR11\u0026amp;dq\u003d%22phenetics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFd4VUoOGCInIkgWUsYHYBQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phenetics%22\u0026amp;f\u003dfalse page xi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Microbial systematics has enjoyed two major advances in the latter half of this century: the introductions of numerical \u0027\u0027phenetics\u0027\u0027 and molecular techniques for direct comparisons of organismal genomes. Numerical \u0027\u0027phenetics\u0027\u0027 (taxonomy) was very influential during the 1960s and 70s in providing the first objective approach to bacterial classification\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Jody Hey, \u0027Genes, Categories, and Species: The Evolutionary and Cognitive Cause of the Species Problem\u0027, [http://books.google.com.au/books?id\u003djq770iGqyoYC\u0026amp;pg\u003dPA147\u0026amp;dq\u003d%22phenetics%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFd4VUoOGCInIkgWUsYHYBQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22phenetics%22\u0026amp;f\u003dfalse page 147\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"One of the most famous and fully developed arguments along these lines, was a justification for \u0027\u0027phenetics\u0027\u0027, a school of systematic thought that proposed mathematical methods for grouping organisms based on measurements of similarity {Sokal and Sneath 1963\", \"priority\":10}]}, \"synonyms\":{}}");

