	add("phenomenon", "{\"term\":\"phenomenon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027phaenomenon\u0027 (appearance) from Ancient greek (to 1453) \u0027φαινόμενον\u0027 (thing appearing to view) neuter present passive participle of \u0027φαίνω\u0027 (i show)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing or being, event or process, perceptible through senses; or a fact or occurrence thereof\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Andrew Andrew Lang, \u0027The Making of Religion\u0027, ch. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Indians, making a hasty inference from a trivial \u0027\u0027phenomenon\u0027\u0027, arrived unawares at a probably correct conclusion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0026quot;[http://www.usatoday.com/weather/resources/askjack/wfaqhur.htm Ask the Experts: Hurricanes],\u0026quot; \u0027USA Today\u0027, 7 Nov. (retrieved 16 Jan. 2009\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hurricanes are a meteorological \u0027\u0027phenomenon\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"extension)\u0027 A knowable thing or event \u0027(eg by inference, especially in science\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An electromagnetic \u0027\u0027phenomenon\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"metonymy)\u0027 A kind or type of phenomenon \u0027(sense 1 or 2\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A volcanic eruption is an impressive \u0027\u0027phenomenon\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Appearance; a perceptible aspect of something that is mutable\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, Thomas Salusbury (translator), \u0027Galileo\u0027s Dialogue Concerning the Two Chief Systems of the World\u0027, First Day\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"I verily believe that in the Moon there are no rains, for if Clouds should gather in any part thereof, as they do about the Earth, they would thereupon hide from our sight some of those things, which we with the Telescope behold in the Moon, and in a word, would some way or other change its \u0027\u0027Phœnomenon\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A fact or event considered very unusual, curious, or astonishing by those who witness it\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1816\u0027\u0027, w:Walter Sir Walter Scott, \u0027The Antiquary—Volume I\u0027, ch. 18\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027phenomenon\u0027\u0027 of a huge blazing fire, upon the opposite bank of the glen, again presented itself to the eye of the watchman. . . . He resolved to examine more nearly the object of his wonder\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A wonderful or very remarkable person or thing\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, w:Charles Charles Dickens, \u0027Nicholas Nickleby\u0027, ch. 23\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"quot;This, sir,\u0026quot; said Mr Vincent Crummles, bringing the maiden forward, \u0026quot;this is the infant \u0027\u0027phenomenon\u0027\u0027—Miss Ninetta Crummles.\u0026quot\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, w:Rudyard Rudyard Kipling, \u0026quot;The Phantom Rickshaw\u0026quot\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"But, all the same, you\u0027re a \u0027\u0027phenomenon\u0027\u0027, and as queer a \u0027\u0027phenomenon\u0027\u0027 as you are a blackguard\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"An experienced object whose constitution reflects the order and conceptual structure imposed upon it by the human mind (especially by the powers of perception and understanding\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Samuel Tolver S. Tolver Preston, \u0026quot;Comparison of Some Views of Spencer and Kant,\u0026quot; \u0027Mind\u0027, vol. 9, no. 34, p. 234\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Every \u0026quot;\u0027\u0027phenomenon\u0027\u0027\u0026quot; must be, at any rate, partly subjective or dependent on the subject\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Roy Wood Roy Wood Sellars, \u0026quot;Is There a Cognitive Relation?\u0026quot; \u0027The Journal of Philosophy, Psychology and Scientific Methods\u0027, vol. 9, no. 9, p. 232\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The Kantian \u0027\u0027phenomenon\u0027\u0027 is the real as we are compelled to think it\", \"priority\":25}]}, \"synonyms\":{}}");

